pub enum Error {
    BufferSize {
        name: &'static str,
        needs: usize,
        has: usize,
    },
    CipherError {
        alg: &'static str,
    },
    ConvertError {
        from: &'static str,
        to: &'static str,
    },
    PrivateKeyError,
    InvalidArgumentError {
        alg: &'static str,
        expected: &'static str,
    },
    SystemError {
        call: &'static str,
        raw_os_error: Option<i32>,
    },
}

pub enum Error {
    InvalidEntropyCount(usize),
    NoSuchWord(String),
    ChecksumMismatch,
}
